%% ROMplantData
% Obtains plant data if the ROM is used as the plant
% 
%
% Outputs:
%   t: time
%   u: current
%   x: ROM states
%   z_all:          Outputs with no noise
%   z_cell_voltage: Measured voltage with noise

function [t, u , x , z_all , z_cell_voltage] = ROMplantData(SIM,FLAG,N,P,RESULTS)
    %% Get Noise
        % [InputSig_w , InputSig_v] = getSlinkNoise(SIM,N,P,FLAG);

        [InputSig_w , InputSig_v] = hardcodedNoise;
        
    
    % Find times to obtain noise
    if FLAG.Tswitch == 100 && FLAG.UseROMAsPlant % Troublesome case
        w_k = InputSig_w(:,2)';
        v_k = InputSig_v(:,2)';
        clear InputSig_w InputSig_v
    else
        idx = [1 4:3:length(InputSig_w)];
        w_k = InputSig_w(idx,2)';
        v_k = InputSig_v(idx,2)';
    end
    
    
    %% Get u_k
        t   = SIM.InputSignal(:,1);
        u_k = SIM.InputSignal(:,2);
        u_k = reshape(u_k,1,[]);
        
        u = u_k;
        N_steps = length(u_k);

        z_init = SIM.y_0_FOM;
    
    
    %% Get ROM
    [sys_HK,~] = getHoKalmanROM(SIM,N,P,FLAG,RESULTS);
    if FLAG.EST.SepHK
        for j = 1:N.DesOut
            %% Get SS Matricies
            A_DT = sys_HK{j}.A;
            B_DT = sys_HK{j}.B;
            C_DT = sys_HK{j}.C(P.cell_voltage,:); % Grab Cell Voltage
    
    
            %% Initialize
            [N_measur, N_states] = size(C_DT);
    
            x_EST_sys = nan(N_states,N_steps);
            x_EST_sys(:,1) = zeros(N_states,1);
            
            % z_k       = nan(N_measur,N_steps);
            % z_k(:,1)       = z_init(j,1); %%%%%%% Don't know if this is right!!!!!!!!

    
            %% Actuate System
            for i = 2:N_steps
                x_EST_sys(:,i) = A_DT * x_EST_sys(:,i-1)  +  B_DT * (u_k(i-1)  +  w_k(:,i-1));
                %z_k(:,i)       = C_DT * x_EST_sys(:,i)                        +  v_k(:,i);
            end
    
    
            %% Save Outputs
            x{j}     = x_EST_sys;
            z_all{j} = sys_HK{j}.C * x_EST_sys + z_init([P.cell_voltage,j],1);
  
            if FLAG.ChangePlantVoltageMid
                num_test = length(z_all{j}(P.cell_voltage,:));
                idx_shift = floor(num_test/2);
                shift = zeros(size(z_all{j}(P.cell_voltage,:)));
                shift(idx_shift:end) = shift(idx_shift:end) + FLAG.ShiftValue;
                z_all{j}(P.cell_voltage,:) = z_all{j}(P.cell_voltage,:) + shift;
            end

            % z_all{j}(1,:) = z_all{j}(P.cell_voltage,:) + v_k(1,1:end-1);
            z_cell_voltage{j} = z_all{j}(P.cell_voltage,:) + v_k(1,1:length(z_all{j}(P.cell_voltage,:)));
    
        end
    
    else
        %% Get SS Matricies
        A_DT = sys_HK{end}.A;
        B_DT = sys_HK{end}.B;
        C_DT = sys_HK{end}.C(P.cell_voltage,:);
    
    
        %% Initialize
        [N_measur, N_states] = size(C_DT);
    
        x_EST_sys = nan(N_states,N_steps);
        x_EST_sys(:,1) = zeros(N_states,1);

        % z_k       = nan(N_measur,N_steps);
    

        %% Actuate System
        for i = 2:N_steps
            x_EST_sys(:,i) = A_DT * x_EST_sys(:,i-1)  +  B_DT * (u_k(i-1)  +  w_k(:,i-1));
            %z_k(:,i)       = C_DT * x_EST_sys(:,i)                        +  v_k(:,i);
        end
    
    
        %% Save Outputs
        x{1}     = x_EST_sys;
        z_all{1} = sys_HK{end}.C * x_EST_sys + z_init;
  
            if FLAG.ChangePlantVoltageMid
                num_test = length(z_all{1}(P.cell_voltage,:));
                idx_shift = floor(num_test/2);
                shift = zeros(size(z_all{1}(P.cell_voltage,:)));
                shift(idx_shift:end) = shift(idx_shift:end) + FLAG.ShiftValue;
                z_all{1}(P.cell_voltage,:) = z_all{1}(P.cell_voltage,:) + shift;
            end

        % z_all{1}(1,:) = z_all{1}(P.cell_voltage,:) + v_k(1,1:end-1);
        % z_cell_voltage{1} = z_all{1}(P.cell_voltage,:) + v_k(1,1:end-1);
        z_cell_voltage{1} = z_all{1}(P.cell_voltage,:) + v_k(1,1:length(z_all{1}(P.cell_voltage,:)));
    end
end

